          projectInfo.searchText,
          projectInfo.searchText,
        ],
        (err, results) => {
          if (err) {
            if (err.code != 'ER_DBERROR') {
              throw err;
            }
            reject(`${err}`);
          } else {
            console.log(results);
            resolve({ success: true, projectData: results });
          }
        }
      );
    });
  }

